import React from 'react';
import { Card } from 'antd';
import './App.css';

function CurrencyCard(props) {
  return (
    <div className="App">
      <header className="App-header">
        <Card title={this.props.title}>Card content</Card>
      </header>
    </div>
  );
}

export default CurrencyCard;
